import React from 'react'
import AddIcon from '@mui/icons-material/Add';

const Header = () => {
  return (
    <div className='text-2xl flex justify-between items-center font-bold text-red-500 p-3 border-b-2 border-gray-500'>
       <span>Filmy<span className='text-white'>Web</span></span>
       <h1 className='text-lg text-white'>
        <AddIcon className='mr-2' color='inherit'/>Add New</h1>
    </div>
  )
}

export default Header;
